import React, { useState } from 'react'
import './App.css';
import Header from './components/Header';
import BenchmarkDataFilter from './components/BenchmarkDataFilter'
import { ThemeProvider } from '@material-ui/core/styles';
import { toggleTheme } from './components/themes.js';

import { createTheme } from "@mui/material/styles";
import Button from "@mui/material/Button";

const themeee = createTheme({
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          fontSize: "2rem",
          color: "greenyellow"
        }
      }
    }
  }
});

class App extends React.Component {
  constructor(props){
  super(props);

  this.state = {
    selectedTheme: 'dark',
    }
  }

  getTheme = (theme) =>{
    theme === 'light' ? this.setState({selectedTheme: 'light'}) : this.setState({selectedTheme: 'dark'})
  }

  render() {
    return (
      <React.Fragment>
        <ThemeProvider theme={ themeee }>
        <Button>font-size: 1rem</Button>
              <Header callback = {this.getTheme}/>
              <BenchmarkDataFilter />    

        </ThemeProvider>
      </React.Fragment>
    );
  }
}

export default App;
